import styled from 'styled-components';
import Hero from '../components/ui/hero';
import Navbar from './navbar';
import '../global.css';

const Styled = styled.div``;

const Layout = ({ children }) => {
  return (
    <>
      <Hero heroSize={true}>
        <Navbar />
      </Hero>
      {children}
    </>
  );
};

export default Layout;
